import React from "react";
import "./Footer.css";
import Typewriter from "typewriter-effect";

const Footer = () => {
  return (
    <footer>
      <div className="footer-content">
        <div className="logo"></div>

        <p>2022 - Foxes Timereport </p>
      </div>
      <div className="footer-bottom">
        <Typewriter
          onInit={(typewriter) => {
            typewriter

              .typeString("We are: ")
              .pauseFor(1000)
              .typeString("Oliver")
              .deleteChars(6)

              .pauseFor(1000)
              .typeString("Oliver")
              .deleteChars(6)

              .pauseFor(1000)
              .typeString("Oliver")
              .deleteChars(6)
              
              .start();
          }}
        />
        <p>copyright @ </p>
      </div>
    </footer>
  );
};

export default Footer;
